import './Header.css';
import notif from '../assets/notif.svg';
import user from '../assets/user.svg';
import calendar from '../assets/calendar.svg';
import config from '../assets/config.svg';


function Header() {
    return(
        <nav>
            <p className=''>INVENTORY MANAGEMENT SYSTEM</p>
            <ul>
                <li><img src={notif} alt="notif" className="notif"/></li>
                <li><img src={user} alt="user" className="user"/></li>
                <li><img src={calendar} alt="calendar" className="calendar"/></li>
                <li><img src={config} alt="config" className="config"/></li>
            </ul>
        </nav>
    );
}

export default Header;
